import React from 'react'
import styled from 'styled-components'

const ItemWrapper = styled.div`
    display: flex;
    align-items: flex;
    justify-content: center;
    width: 100%;
    padding: 5rem;
`

const MenuItem = ({ name, picture, description }) => {
    return (
        <ItemWrapper>
            {picture} 
            {name}
            <h1></h1>{description}
        </ItemWrapper> 
    )
}

export default MenuItem
